import { Field, reduxForm } from "redux-form";
import { compose } from "redux";
import { Link } from "react-router-dom";
import renderFormGroupField from "../../helpers/renderFormGroupField";
import renderFormField from "../../helpers/renderFormField";
import {
  required,
  maxLength20,
  minLength8,
  maxLengthMobileNo,
  minLengthMobileNo,
  digit,
  name,
} from "../../helpers/validation";
import { ReactComponent as IconPhone } from "bootstrap-icons/icons/phone.svg";
import { ReactComponent as IconShieldLock } from "bootstrap-icons/icons/shield-lock.svg";
import { ReactComponent as IconEmail } from "bootstrap-icons/icons/envelope.svg";
import { useState } from "react";
import useAdmin from "../../hooks/useUser";

const SignUpForm = (props) => {
  const { handleSubmit, submitting, onSubmit, submitFailed } = props;
  const {getAllClientDetails}=useAdmin();
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    mobileNumber: '',
    email: '',
    password: '',
    country:'',
    city: '',
    state:'',
  });


  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };
 const handleSubmitt = (e) => {
    e.preventDefault();
    console.log('Form data:', formData);
    // You can also perform form validation and submit data here
    getAllClientDetails(formData)
  };
console.log(formData);

  return (
    <form
      onSubmit={handleSubmit(onSubmit)}
      className={`needs-validation ${submitFailed ? "was-validated" : ""}`}
      noValidate
    >
      <div className="row mb-3">
        <div className="col-md-6">
          <Field
            name="firstName"
            type="text"
            label="First Name"
            component={renderFormField}
            placeholder="First Name"
            validate={[required, name]}
            required={true}
            value={formData.firstName}
          onChange={handleChange}
          />
        </div>
        <div className="col-md-6">
          <Field
            name="lastName"
            type="text"
            label="Last Name"
            component={renderFormField}
            placeholder="Last Name"
            validate={[required, name]}
            required={true}
            value={formData.lastName}
            onChange={handleChange}
          />
        </div>
      </div>
      <div className="row ">
      <div className="col-md-6">
      <Field
        name="mobileNumber"
        type="number"
        label="Mobile no"
        component={renderFormGroupField}
        placeholder="Mobile no without country code"
        icon={IconPhone}
        validate={[required, maxLengthMobileNo, minLengthMobileNo, digit]}
        required={true}
        max="999999999999999"
        min="9999"
        className="mb-3"
        value={formData.mobileNumber}
          onChange={handleChange}
      />
      </div>
      <div className="col-md-6">
       <Field
        name="email"
        type="email"
        label="Email"
        component={renderFormGroupField}
        placeholder="Email"
        icon={IconEmail}
        required={true}
        value={formData.email}
        onChange={handleChange}
        className="mb-3"
      />
      </div>
      </div>
      <div className="row ">
        <div className="col-md-6">
      <Field
        name="password"
        type="password"
        label="Your password"
        component={renderFormGroupField}
        placeholder="******"
        icon={IconShieldLock}
        validate={[required, maxLength20, minLength8]}
        required={true}
        value={formData.password}
        onChange={handleChange}
        maxLength="20"
        minLength="8"
        className="mb-3"
      />
      </div>
      <div className="col-md-6">
          <Field
            name="city"
            type="text"
            label="City"
            component={renderFormField}
            placeholder="City"
            validate={[required, name]}
            required={true}
            value={formData.lastName}
            onChange={handleChange}
          />
        </div>
      </div>
      <div className="row ">
        <div className="col-md-6">
      <Field
        name="password"
        type="password"
        label="Your password"
        component={renderFormGroupField}
        placeholder="******"
        icon={IconShieldLock}
        validate={[required, maxLength20, minLength8]}
        required={true}
        value={formData.password}
        onChange={handleChange}
        maxLength="20"
        minLength="8"
        className="mb-3"
      />
      </div>
      <div className="col-md-6">
          <Field
            name="city"
            type="text"
            label="City"
            component={renderFormField}
            placeholder="City"
            validate={[required, name]}
            required={true}
            value={formData.lastName}
            onChange={handleChange}
          />
        </div>
      </div>
      <div className="d-grid">
        <button
          type="submit"
          className="btn btn-primary mb-3"
          disabled={submitting}
          onClick={handleSubmitt}
        >
          Create
        </button>
      </div>
      <Link className="float-start" to="/account/signin" title="Sign In">
        Sing In
      </Link>
      <Link
        className="float-end"
        to="/account/forgotpassword"
        title="Forgot Password"
      >
        Forgot password?
      </Link>
      <div className="clearfix"></div>
      <hr></hr>
      <div className="row">
        <div className="col- text-center">
          <p className="text-muted small">Or you can join with</p>
        </div>
        <div className="col- text-center">
          <Link to="/" className="btn btn-light text-white bg-twitter me-3">
            <i className="bi bi-twitter-x" />
          </Link>
          <Link to="/" className="btn btn-light text-white me-3 bg-facebook">
            <i className="bi bi-facebook mx-1" />
          </Link>
          <Link to="/" className="btn btn-light text-white me-3 bg-google">
            <i className="bi bi-google mx-1" />
          </Link>
        </div>
      </div>
    </form>
  );
};

export default compose(
  reduxForm({
    form: "signup",
  })
)(SignUpForm);
